-- Create the table of technologies
CREATE TABLE `plugin_obsolescence_technologies` (
  `id_tech` INT NOT NULL,
  `tech_name` VARCHAR(45) NULL,
  `tech_version` VARCHAR(45) NULL,
  `release` DATE NULL,
  `endoflife` DATE NULL,
  PRIMARY KEY (`id_tech`));
  
-- Insert the technologies in bdd

-- Create the association table between project and technologies
CREATE TABLE `plugin_obsolescence_groups_technologies` (
  `group_id` INT NOT NULL,
  `tech_id` VARCHAR(45) NOT NULL,
  PRIMARY KEY (`group_id`, `tech_id`));
  
